query:
SELECT ?property ?hasValue ?isValueOf
WHERE {
  { <http://dbpedia.org/resource/Guinness> ?property ?hasValue }
  UNION
  { ?isValueOf ?property <http://dbpedia.org/resource/Guinness> }
}

